import React from 'react';
import Card from './Card';
import './Swimlane.css';

export default class Swimlane extends React.Component {
  render() {
    const { clients, name, dragulaRef } = this.props;
    
    // Map each client to a Card component
    const cards = clients.map(client => (
      <Card
        key={client.id}
        id={client.id}
        name={client.name}
        description={client.description}
        status={client.status}  // The status passed here will affect the color
      />
    ));

    return (
      <div className="Swimlane-column" data-status={name.toLowerCase()} ref={dragulaRef}>
        <div className="Swimlane-title">{name}</div>
        <div className="Swimlane-dragColumn">
          {cards}
        </div>
      </div>
    );
  }
}
